from typing import List

class Solution1:
    def subarraysDivByK(self, A: List[int], K: int) -> int:
        #超时了,
        dp=[]    #含义：dp[1] 表示A[0]+...A[1]的和（前缀和）
        res=0
        for i in A:
            res+=i
            dp.append(res)
        ret=0
        for i in range(len(A)):
            for j in range(i):
                if (dp[i]-dp[j])%K==0:
                    ret+=1
            if dp[i]%K==0:
                ret+=1
        return ret
class Solution:
    def subarraysDivByK(self, A: List[int], K: int) -> int:
        #同余定理: 若(P[j]−P[i−1]) mod K==0,则P[j] mod K==P[i−1] mod K(反之成立)
        mem={0:1}
        res=0
        cur_sum=0
        for i in A:
            cur_sum+=i
            mod=cur_sum%K
            v=mem.get(mod,0)
            res+=v
            mem[mod]=v+1
        return res
